    @Test
    void testMasterListParse() throws Exception {
        var listBase64 =
                "";
        var list = new String(Base64.getDecoder().decode(listBase64));

        var parser = new MasterPlaylistParser();
        var masterPlaylist = parser.readPlaylist(list);

        System.out.println(parser.writePlaylistAsString(masterPlaylist));

        masterPlaylist.variants().stream()
                .filter(
                        variant ->
                                variant.resolution().isPresent()
                                        && variant.resolution()
                                                .get()
                                                .equals(Resolution.of(1920, 1080)))
                .findFirst()
                .ifPresent(System.out::println);
    }

