    @Test
    void testNormalizeMediaSlicesUri() throws Exception {
        var mediaInfo =
                Paths.get(
                        ReverseEngineeringTest.class
                                .getResource("/reverse_engineering/mediainfo.m3u8")
                                .toURI());
        var playlist = Files.readString(mediaInfo);
        var parser = new MediaPlaylistParser(ParsingMode.LENIENT);
        var mediaPlaylist = parser.readPlaylist(playlist);

        var condensedUrl =
                mediaPlaylist.comments().stream()
                        .filter(comment -> comment.startsWith("YT-EXT-CONDENSED-URL:"))
                        .map(comment -> comment.replace("YT-EXT-CONDENSED-URL:", ""))
                        .flatMap(
                                attributes ->
                                        Pattern.compile("([A-Z0-9\\-]+)=(?:\"([^\"]+)\"|([^,]+))")
                                                .matcher(attributes)
                                                .results())
                        .collect(
                                Collectors.toMap(
                                        matcher -> matcher.group(1),
                                        matcher ->
                                                matcher.group(2) != null
                                                        ? matcher.group(2)
                                                        : matcher.group(3)));

        System.out.println(condensedUrl);

        mediaPlaylist =
                MediaPlaylist.builder()
                        .from(mediaPlaylist)
                        .mediaSegments(
                                mediaPlaylist.mediaSegments().stream()
                                        .map(
                                                old ->
                                                        MediaSegment.builder()
                                                                .from(old)
                                                                .uri(
                                                                        condensedUrl.get("BASE-URI")
                                                                                + "/"
                                                                                + old.uri())
                                                                .build())
                                        .toList())
                        .build();

        System.out.println(parser.writePlaylistAsString(mediaPlaylist));
    }
